import React from "react";
export default function Contact() {
  return (
    <div className="contact">
      <ul className="contact-list">
        <li>
          {" "}
          <a href="https://www.linkedin.com/in/mohamed-amiir/" class="li-button">
            LinkedIn
          </a>
        </li>
        <li>
          {" "}
          <a href="https://www.linkedin.com/in/mohamed-amiir/" class="gm-button">
            Gmail
          </a>
        </li>
      </ul>
    </div>
  );
}
